import React from 'react';
import Logo_user from '../images/person.png'; // Adjust the path if necessary

const Login_user_interface = () => {
  return (
    <div className='Login_user_interface'>
      <div className='Login_user_interface_Icon'>
        <img src={Logo_user} alt="User Icon" /> {/* Added alt attribute for accessibility */}
      </div>
      <div className='Login_user_interface_user_name'>
        NAHDI GHAITH
      </div>
      <div className='Login_user_interface_sign_in'>
        SIGN IN
      </div>
    </div>
  );
};

export default Login_user_interface;
